export const setSearchFor = (searchFor) => {
    console.log('HELLO')
    return async dispatch => {
        dispatch({
            type: 'SET_SF',
            data: searchFor
        })
    }
}

const searchFor = (state = 'projects', action) => {
    switch (action.type) {
        case 'SET_SF' :
            console.log(action.data)
            return action.data
        default :
            return state
    }
}

export default searchFor
